glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in vec4 a_color;
out vec4 v_color;
#if USE_TEXTURE
  in vec2 a_uv0;
  out vec2 v_uv0;
  uniform TexCoords {
    vec4 tilingOffset;
  };
#endif
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  #if USE_TEXTURE
    v_uv0 = a_uv0;
    #if FLIP_UV
      v_uv0.y = 1.0 - v_uv0.y;
    #endif
    v_uv0 = v_uv0 * tilingOffset.xy + tilingOffset.zw;
  #endif
  v_color = a_color;
  gl_Position = pos;
}

glsl3.frag:
precision highp float;
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
in vec4 v_color;
#if USE_TEXTURE
  in vec2 v_uv0;
  uniform sampler2D texture;
  uniform Tex {
    float Samples;
    float Strength;
    vec2 center;
    float interv;
  };
#endif
#if USE_COLOR
  uniform Constant {
    vec4 color;
  };
#endif
void main () {
  vec4 o = vec4(0, 0, 0, 0);
  #if USE_TEXTURE
    vec2 dir = v_uv0 - center;
    for (float x = 0.0; x <= 3.0; x++) {
      o += texture(texture, vec2(v_uv0.x,v_uv0.y + x / Samples * dir.y * Strength));
      o += texture(texture, vec2(v_uv0.x,v_uv0.y + (x+interv) / Samples * dir.y * Strength));
    }
    o = o / Samples;
  #endif
  #if USE_COLOR
    o *= color;
  #endif
  o *= v_color;
  gl_FragColor = o;
}

glsl1.vert:
precision highp float;
uniform mat4 cc_matViewProj;
uniform mat4 cc_matWorld;
attribute vec3 a_position;
attribute vec4 a_color;
varying vec4 v_color;
#if USE_TEXTURE
  attribute vec2 a_uv0;
  varying vec2 v_uv0;
  uniform vec4 tilingOffset;
#endif
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  #if USE_TEXTURE
    v_uv0 = a_uv0;
    #if FLIP_UV
      v_uv0.y = 1.0 - v_uv0.y;
    #endif
    v_uv0 = v_uv0 * tilingOffset.xy + tilingOffset.zw;
  #endif
  v_color = a_color;
  gl_Position = pos;
}

glsl1.frag:
precision highp float;
#if USE_ALPHA_TEST
#endif
varying vec4 v_color;
#if USE_TEXTURE
  varying vec2 v_uv0;
  uniform sampler2D texture;
  uniform float Samples;
uniform float Strength;
uniform vec2 center;
uniform float interv;
#endif
#if USE_COLOR
  uniform vec4 color;
#endif
void main () {
  vec4 o = vec4(0, 0, 0, 0);
  #if USE_TEXTURE
    vec2 dir = v_uv0 - center;
    for (float x = 0.0; x <= 3.0; x++) {
      o += texture2D(texture, vec2(v_uv0.x,v_uv0.y + x / Samples * dir.y * Strength));
      o += texture2D(texture, vec2(v_uv0.x,v_uv0.y + (x+interv) / Samples * dir.y * Strength));
    }
    o = o / Samples;
  #endif
  #if USE_COLOR
    o *= color;
  #endif
  o *= v_color;
  gl_FragColor = o;
}
